  return (
    <div className="container">
    <BrowserRouter>
    <Routes>
      <Route exact path="/" element={<Create />}></Route>
      <Route exact path="/read" element={<Read />}></Route>       
      <Route exact path="/update" element={<R />}></Route>       

    </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
